    def k_elements(matrix, k):
        n, m, k = int(len(matrix)), int(len(matrix[0])), int(k)

        # counting the number of elements in each row
        rows = [0] * n
        for i in range(n):
            for j in range(m):
                if matrix[i][j] == 0:
                    rows[i] += 0
                else:
                    rows[i] += 1
        rows = sorted(rows)

        # counting the number of elements in each column
        cols = [[] for i in range(m)]
        for i in range(m):
            for j in range(n):
                if matrix[j][i] == 0:
                    cols[i].append(0)
                else:
                    cols[i].append(rows[j])

        # counting the number of elements in each square
        squares = [[] for i in range(n)]
        for i in range(n):
            for j in range(m):
                if matrix[i][j] == 0:
                    squares[i].append(0)
                else:
                    squares[i].append(rows[j])

        # choose at most a half of the elements in each square
        total = 0
        for i in range(n):
            for j in range(m):
                if matrix[i][j] == 0:
                    continue
                else:
                    square_size = min(k // 2, squares[i][j])
                    total += squares[i][j] - square_size
                    for k in range(i, i + square_size):
                        for l in range(j, j + square_size):
                            matrix[k][l] = 0
        return total

    return str(k_elements(list(map(lambda x: list(map(lambda y: int(y), x.split())), stdin.split('\n'))), k))


