    beauties = list(map(int, stdin.split()))

    if sum(beauties) <= x:
        return -1

    left = 0
    right = 0
    sum_ = 0

    for right in range(len(beauties)):
        if sum(beauties[left:right]) <= x:
            if right - left > k:
                if right - left < k - 1:
                    sum_ = sum(beauties[left:right])
                else:
                    return -1
            else:
                sum_ = max(sum_, sum(beauties[left:right]))
        left += 1

    return sum_

