            if vals[i] + 1 < vals[i+1]:
                return False
        return True

    def extend(string: str, vals: List[str]) -> List[str]:
        vals = to_parse(string, vals)
        vals.append(-1)
        return vals

    def backtrack(string: str, vals: List[str]) -> bool:
        if len(string) == 0:
            if valid_sequence(string):
                return True
            else:
                return False
        else:
            for i in range(len(string)):
                vals = extend(string[:i]+string[i+1:], vals)
                if backtrack(string[:i]+string[i+1:], vals):
                    return True
            return False

    vals = to_parse(stdin, [])
    vals.append(-1)
    return (backtrack(stdin, vals))

