class Graph:
    def __init__(self, graph_string: str):
        self.edges = []
        self.n = 0
        self.weights = None
        self.is_cyclic = False
        self.is_edge_dir = None
        for edge_string in graph_string.split('\n'):
            if not edge_string:
                continue
            v1, v2 = edge_string.split()
            self.add_edge(int(v1), int(v2))

    def add_edge(self, v1, v2):
        self.edges.append(Edge(v1, v2))
        self.edges.append(Edge(v2, v1))
        self.n = max(self.n, v1, v2) + 1

    def is_cyclic(self):
        if self.is_cyclic:
            return
        self.is_cyclic = True
        for e in self.edges:
            if e.v == e.u:
                continue
            v = e.v
            u = e.u
            if self.is_edge_dir(v, u):
                self.is_cyclic = False
            else:
                self.is_cyclic = self.is_cyclic or self.is_cyclic(v, u)
        return self.is_cyclic

    def is_edge_dir(self, v1, v2):
        if self.weights is None:
            self.weights = [0] * (self.n + 1)
            for e in self.edges:
                self.weights[e.v] += 1
                self.weights[e.u] += 1
            for i in range(1, self.n + 1):
                if self.weights[i] == 0:
                    self.weights[i] = i
        return self.weights[v1] == self.weights[v2]


